window.bookSummaryJSON = "<p>One day, 15-year-old Emily Dickinson meets a mysterious, handsome young man. Surprisingly, he doesn't seem to know who she or her family is. And even more surprisingly, he playfully refuses to divulge his name. Emily enjoys her secret flirtation with Mr. \"Nobody\" until he turns up dead in her family's pond. She's stricken with guilt. Only Emily can discover who this enigmatic stranger was before he's condemned to be buried in an anonymous grave. Her investigation takes her deep into town secrets, blossoming romance, and deadly danger. Exquisitely written and meticulously researched, this novel celebrates Emily Dickinson's intellect and spunk in a page-turner of a book that will excite fans of mystery, romance, and poetry alike.</p>"; 
